// Next.JS expects babel.config.js in app root, we want /pages in /src folder so we have it here
module.exports = (api) => {
  api.cache(false);

  return {
    presets: ['next/babel'],
    plugins: [],
  };
};

// This file is used to run health checks with Node in the Docker container

var http = require('http');

var options = {
  host: 'localhost',
  port: '3000',
  timeout: 2000,
};

var request = http.request(options, (res) => {
  console.log(`STATUS: ${res.statusCode}`);

  if (res.statusCode == 200) {
    process.exit(0);
  } else {
    process.exit(1);
  }
});

request.on('error', function (err) {
  console.log('ERROR');
  process.exit(1);
});

request.end();

// Fail tests on any warning
