  testMatch: ['**/__tests__/**/*.ts?(x)', '**/?(*.)+(spec).ts?(x)'],
  verbose: true,
  globals: {
    'ts-jest': {
      tsconfig: 'tsconfig-server.json',
    },
  },
};

